import styles from "./Button.module.css";
const Button = () => {
  const addUserHandler = (event) => {
    event.preventdefault();
  };

  return (
    <button onClick={addUserHandler} className={styles.button} type="submit">
      Add User
    </button>
  );
};
export default Button;
